import React, { useEffect, useState } from "react";
import Alert from '@mui/material/Alert';
import { DataGrid } from '@mui/x-data-grid';
import { v4 as uuidv4 } from 'uuid';
import { io } from "socket.io-client";
import baseURL from "../utils/baseURL";
import './CameraVisualDataCollection.css';
import {
  Box,
  Grid,
  Chip,
  Divider,
  Card,
  CardContent,
  Typography,
  Paper,
  CircularProgress,
} from "@mui/material";
import apiService from "../api/acoustics";

const columns = [
  { field: 'Predicted Class', headerName: 'Class to Speech', flex: 0.3, renderCell: predictedClassSpeech },
  { field: 'PredictedClass', headerName: 'Predicted Class', flex: 0.5, minWidth: 5 },
  { field: 'Anomaly', headerName: 'Anomaly / Anomaly Audio', flex: 0.4, renderCell: getAnomalyStatus, align: 'center' },
  { field: 'filename', headerName: 'Sample Audio', flex: 0.5, renderCell: getAudioFile },
  { field: 'Softmax', headerName: 'Prediction Probability (%)', flex: 0.5, minWidth: 5, align: 'center' },
  { field: 'filePath', headerName: 'Audio Path', flex: 0.5, renderCell: getAudioPath }
];

const CameraVisualDataCollection = () => {
  const [isError, setIsError] = useState(false);
  const [connectionMsg, setConnectionMsg] = useState("");
  const [cameraResults, setCameraResults] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  // Fetch camera results
  const fetchCameraResults = async () => {
    setIsLoading(true);
    try {
      const response = await fetch('http://192.168.1.111:5000/camera-results');
      if (response.ok) {
        const results = await response.json();
        setCameraResults(results);
      } else {
        console.error('Failed to fetch camera results');
      }
    } catch (error) {
      console.error('Error fetching camera results:', error);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => {
    fetchCameraResults();
  }, []);

  const displayCard = (
    <CardContent style={{ backgroundColor: "#fff8e1" }}>
      <Typography gutterBottom component="div" align='center' sx={{ color: "black", fontSize: 60, mt: 4, textTransform: 'uppercase', height: 80 }}>
        <Typography variant="h6" color="text.primary" sx={{ color: 'black', mt: 1 }}>
          Camera Visual Data Collection
        </Typography>
      </Typography>
      <Divider><Chip label="." /></Divider>
      <Typography variant="h6" color="text.primary" sx={{ color: 'black', mt: 1 }}>
        {cameraResults.length > 0 ? 'Data Available' : 'No Data Available'}
      </Typography>
    </CardContent>
  );

  return (
    <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justify="center"
      style={{ minHeight: "100vh" }}
    >
      <Card sx={{ minWidth: 800, mb: 4 }} style={{ backgroundColor: "#026ca0" }}>
        {displayCard}
      </Card>

      <div style={{ minHeight: "15vh", width: '100%' }}>
        <DataGrid rows={cameraResults} columns={columns} sortingOrder="[asc]" autoHeight
          initialState={{
            pagination: {
              paginationModel: {
                pageSize: 15,
              },
            },
          }}
          pageSizeOptions={[25, 50, 70, 100]}
          experimentalFeatures={{ rowGrouping: true }}
          getRowId={(row) => row.id || uuidv4()} />
      </div>

      <Grid item xs={12} sm={12} md={12} lg={12}>
        <Grid item xs={12} md={12}>
          <div
            style={{ display: isError ? "flex" : "None", alignItems: "center" }}
            xs={12}
            md={6}
          >
          </div>
        </Grid>

        <Box display="flex" alignItems="center" justifyItems="center">
          <Alert sx={{ severity: isError ? "error" : "success" }}>{connectionMsg}</Alert>
        </Box>
      </Grid>

      <Box style={{ marginTop: '20px', width: '100%' }}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Paper elevation={3} className="results-section">
              <Typography variant="h5" gutterBottom>
                Camera Visual Data
              </Typography>
              <Box
                className="camera-results"
                style={{
                  padding: '10px',
                  border: '1px solid #ccc',
                  backgroundColor: '#f9f9f9',
                }}
              >
                {isLoading ? (
                  <CircularProgress />
                ) : cameraResults.length > 0 ? (
                  cameraResults.map((result, index) => (
                    <Typography key={index} variant="body2">
                      {result}
                    </Typography>
                  ))
                ) : (
                  <Typography variant="body2">No camera results available.</Typography>
                )}
              </Box>
            </Paper>
          </Grid>
        </Grid>
      </Box>
    </Grid>
  );
};

export default CameraVisualDataCollection;
